// src/pages/TutorList.jsx
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import api from '../services/api';

export default function TutorList() {
  const [tutores, setTutores] = useState([]);

  useEffect(() => {
    api.get('/tutores').then(res => setTutores(res.data));
  }, []);

  return (
    <div className="container my-5">
      <div className="d-flex justify-content-end mb-3">
        <Link to="/" className="btn btn-secondary me-2">← Voltar ao Início</Link>
        <Link to="/tutores/novo" className="btn btn-primary">+ Cadastrar Novo Tutor</Link>
      </div>

      <h2 className="mb-4">Tutores Cadastrados</h2>

      {tutores.map((tutor) => (
        <div key={tutor._id} className="border rounded p-2 mb-2">
          <Link
            to={`/tutores/${tutor._id}`}
            style={{ textDecoration: 'none', color: 'inherit' }}
          >
            <strong>{tutor.nome}</strong> – CPF: {tutor.cpf}
          </Link>
        </div>
      ))}
    </div>
  );
}
